def compare_numbers(x1: int, p1: int, x2: int, p2: int) -> str:
    """
    Compares two numbers where one number is a positive integer x with p zeros appended.

    Args:
        x1 (int): The base positive integer of the first number.
        p1 (int): The number of zeros to append to the first number.
        x2 (int): The base positive integer of the second number.
        p2 (int): The number of zeros to append to the second number.

    Returns:
        str: '<' if the first number is smaller, '>' if the first number is larger, '=' if they are equal.
    """
