    while x1 % 10 == 0 and p1 > 0:
        x1 //= 10
        p1 -= 1
    while x2 % 10 == 0 and p2 > 0:
        x2 //= 10
        p2 -= 1

    # Compare the lengths of the numbers after removing the zeros
    if p1 > p2:
        return '>'
    elif p1 < p2:
        return '<'
    else:
        # If the lengths are equal, compare the original numbers without the zeros
        if x1 > x2:
            return '>'
        elif x1 < x2:
            return '<'
        else:
            return '='

